import React, { Component } from "react";

class apiS extends Component {
    componentDidMount(){
        fetch('http://numbersapi.com/random/date')
        .then(resp => resp.json())
        .then(data => console.log(data)).catch((err)=> console.log("ops.. have an Error." + err))
    }
    render(){
        return(
            <div></div>
        )
    }
}
export default apiS;
